CREATE TABLE mytable(
   produkt_id    VARCHAR(36) NOT NULL PRIMARY KEY
  ,produkt_nazwa VARCHAR(35) NOT NULL
  ,produkt_cena  NUMERIC(5,1) NOT NULL
  ,produkt_smak  VARCHAR(29) NOT NULL
  ,produkt_moc   INTEGER  NOT NULL
  ,produkt_foto  VARCHAR(48) NOT NULL
  ,produkt_typ   VARCHAR(12) NOT NULL
);
